description:
The Pretenders - Brass In Pocket [Top of the Pops 1979].VOB



HQ rare &quot;Top of the Pops&quot; tv show promo performance. Top of the Pops, also known as TOTP, is a music chart television program, made by the BBC and originally broadcast weekly from 1 January 1964 to 30 July 2006. 

Each weekly program consisted of performances from some of that week's best-selling popular music artists, with a rundown of that week's singles chart. Additionally, every year there was a special edition of the program on Christmas Day featuring some of the best-selling singles of the year. 

&quot;Brass in Pocket&quot; (also known as &quot;Brass in Pocket (I'm Special)&quot;) is a single by The Pretenders. It was written by Chrissie Hynde and James Honeyman-Scott, and produced by Chris Thomas.

The band's third single, it was their first success, scoring number one on the UK Singles Chart for two weeks in January 1980 (making it the first number-one single of the 1980s), number one in Australia during May 1980, and number 14 on the Billboard Hot 100 chart in the United States. 
